const record = () => {
  /* Record sound into base64 */
  let recorder = null;

  const onsuccess = (stream) => {
    recorder = new MediaRecorder(stream, {
      type: 'audio/ogg; codecs=opus',
    });
    alert('Click OK to record');
    recorder.start(); // Starting the record

    recorder.ondataavailable = (e) => {
      // Converting audio blob to base64
      let reader = new FileReader();
      reader.onloadend = () => {
        console.log(reader.result);
        // You can upload the base64 to server here.
      };

      reader.readAsDataURL(e.data);
    };

    setTimeout(() => {
      recorder.stop(); // Stopping the recorder after 2 seconds
      alert('Recording completed. See base64 output in the console.');
    }, 2000);
  };

  navigator.getUserMedia =
    navigator.getUserMedia ||
    navigator.webkitGetUserMedia ||
    navigator.mozGetUserMedia ||
    navigator.msGetUserMedia;

  navigator.getUserMedia(
    {
      audio: true,
    },
    onsuccess,
    (e) => {
      console.log(e);
    }
  );
};
